import React, { useState} from "react";
import LandingPage from "./LandingPage";
import Footer from "./Footer";
import { Route, Routes } from "react-router-dom";
import Header from "./Header";
import NavBar from "./Header/NavBar";

function App() {

  const [isHome, setIsHome] = useState(true);
  const [isAbout, setIsAbout] = useState(false);
  const [isProjects, setIsProjects] = useState(false);

  const [content, setContent] = useState(null);

  return (
    <div>
      <Header />
      <NavBar  setIsHome={setIsHome} setIsAbout={setIsAbout} setIsProjects={setIsProjects} content={content} setContent={setContent}/>
      <div className="ml-8 mt-10 mb-10 mobile-landing">
        <LandingPage
          content={content}
        />
      </div>
      {/* <Routes> */}
        {/* <Route exact path="/home" element={<LandingPage />} /> */}
      {/* </Routes> */}
      <Footer  setIsHome={setIsHome} setIsAbout={setIsAbout} setIsProjects={setIsProjects} content={content} setContent={setContent}/>
    </div>
  );
}

export default App;
